import logo from './logo.svg';
import './App.css';

function App() {
  let list = ["Leanna Graham", "Ervin Howell", "Patricia Lebsack","Chelsey Dietrich", "Mr. Dennis"]
  let itemList = list.map((x, index) => {
    return <li key={`${x}-${index}`}>{x}</li>
  })
  let handleChange = e => {
    let value = e.target.value
  }
  return (
    <div className="App">
      <input name="search" onChange={e => handleChange(e)} />
      <div>
        <ul>
          {itemList}
        </ul>
      </div>
    </div>
  );
}

export default App;
